"use strict";

const moment = require("moment-timezone");
const environments = require("../../environments/varEnvironments");
const fs = require("fs");
const PDFDocument = require("pdfkit");
const Jimp = require("jimp");
const path = require("path");

// __dirname = .../dist/controllers/medicalConsultation
const projectRoot = path.resolve(__dirname, "../../../"); // /opt/render/project/src
const CANNA_DOCS_DIR = path.join(projectRoot, "CannaDocs");
const SIGNATURES_DIR = path.join(CANNA_DOCS_DIR, "doctorSignatures");

async function generateMedicalRecipe(consultationData, medicalTreatament, type) {
  return new Promise(async (resolve, reject) => {
    try {
      const doc = new PDFDocument({ size: "A4", margin: 50 });
      //const headerImage = 'data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/...'; // Imagen base64 para el encabezado
      const headerImage = 'data:image/png;base64,';

      const pdfPath = getPdfPath(consultationData);
      const writeStream = fs.createWriteStream(pdfPath);
      doc.pipe(writeStream);

      // Funcin para agregar encabezado
      function addHeader() {
        doc.image(headerImage, 390, 30, { width: 150 })
          .fontSize(16)
          .text("CONSULTORIO MDICO CANNAHOPE", 50, 60)
          .fontSize(13)
          .text("Ferreyros 291 - San Isidro", 50, 90)
          .text("contacto@centrocannahope.com", 50, 105)
          .text("+51 954 761 773", 50, 120)
          .moveDown();

        const currentDate = moment().tz("America/Lima").format("DD/MM/YYYY");
        doc.fontSize(12).text(`Fecha: ${currentDate}`, 50, 150);

      }

      // Funcin para agregar datos del doctor
      function addDoctorData() {
        const doctorTitle = consultationData.doctor.sex === "MASCULINO" ? "Dr." : "Dra.";
        const specialty = consultationData.doctor.specialty?.name || "N/A";
        doc.rect(15, 190, 565, 55).stroke();
        doc.rect(15, 190, 255, 55).stroke();
        doc.fontSize(10)
          .text("MDICO: ", 50, 200)
          .text(`${doctorTitle} ${consultationData.doctor.names.toUpperCase()} ${consultationData.doctor.surenames.toUpperCase()}`, 110, 200)
          .text("ESPECIALIDAD: ", 50, 215)
          .text(specialty.toUpperCase(), 140, 215)
          .text("CMP: ", 50, 230)
          .text(consultationData.doctor.doctorCmp || "", 90, 230);
      }

      // Funcin para agregar datos del paciente
      function addPatientData() {
        doc.fontSize(10)
          .text("PACIENTE: ", 300, 200)
          .text(`${consultationData.patient.user.names.toUpperCase()} ${consultationData.patient.user.surenames.toUpperCase()}`, 360, 200)
          .text("DNI: ", 300, 215)
          .text(consultationData.patient.user.document, 330, 215)
          .text("EDAD: ", 300, 230)
          .text(consultationData.patient.user.age.toString(), 330, 230);
      }

      // Funcin para agregar diagnstico
      function addDiagnostic() {
        doc.rect(15, 250, 565, 20).stroke();
        const diagnostic = consultationData.medicalDiagnostic.disease.map(d => d.name.toUpperCase()).join(", ");
        doc.fontSize(10).text("DIAGNSTICO: ", 50, 260).text(diagnostic, 130, 260);
      }

      // Funcin para agregar tratamientos
      function addTreatments() {
        let offsetY = 290;
        //doc.rect(15, 285, 565, 20).stroke();
        medicalTreatament.forEach((item) => {
          doc.fontSize(10)
            .text("VIA DE ADMINISTRACIN: ", 50, offsetY)
            .text(item.viaAdministracion.toUpperCase(), 175, offsetY)
            .text("FITOCANNABINOIDES: ", 50, offsetY + 15)
            .text(item.fitocannabinoides.toUpperCase(), 175, offsetY + 15)
            .text("CONCENTRACIN: ", 50, offsetY + 30)
            .text(item.concentracion.toUpperCase(), 175, offsetY + 30)
            .text("RATIO: ", 50, offsetY + 45)
            .text(item.ratio.toUpperCase(), 175, offsetY + 45)
            .text("FRECUENCIA: ", 50, offsetY + 60)
            .text(`${item.frequency.toUpperCase()} VECES POR DA`, 175, offsetY + 60);

          if (item.amountPerDose) {
            doc.text("GOTAS POR DOSIS: ", 50, offsetY + 75).text(item.amountPerDose.toString(), 175, offsetY + 75);
          }

          if (item.conditions) {
            doc.text("CONDICIONES: ", 50, offsetY + 90)
              .text(item.conditions, 50, offsetY + 105, { width: 400 });
          }


          doc.text("OBSERVACIONES: ", 300, offsetY - 10)
            .text(item.observations || "", 300, offsetY + 5, { width: 200 });
          
          offsetY += 155;
        });

        doc.rect(15, 275, 565, offsetY + 100).stroke();
      }

      // Firma del doctor
    async function addDoctorSignature() {
      const sigFile = consultationData?.doctor?.signatureImage;
      if (!sigFile) {
        console.warn("No doctor signatureImage found in consultationData.doctor");
        return;
      }

      const signaturePath = path.join(getSignaturePath(), sigFile);
      console.log("Doctor signature path:", signaturePath);

      if (!fs.existsSync(signaturePath)) {
        console.warn(`Doctor signature file not found: ${signaturePath}`);
        return; // no rompemos el PDF, solo lo generamos sin firma
      }

      try {
        const image = await Jimp.read(signaturePath);
        const newSignaturePath = signaturePath.replace(/\.(png|jpg|jpeg)$/i, ".jpg");
        await image.writeAsync(newSignaturePath); // mejor writeAsync
        doc.image(newSignaturePath, 330, 600, { width: 180 });
      } catch (err) {
        console.error("Error processing doctor signature image:", err);
        // seguimos sin tirar el PDF
      }
    }

      // Agregar todos los elementos al PDF
      addHeader();
      addDoctorData();
      addPatientData();
      addDiagnostic();
      addTreatments();

      // Agregar la firma del doctor y finalizar el documento
      await addDoctorSignature();
      doc.text("REEVALUACIN EN 1 MES A PARTIR DE LA FECHA.", 50, 750);

      doc.end();
      writeStream.on("finish", () => resolve(pdfPath));
    } catch (error) {
      console.error("Error generating medical recipe:", error);
      reject(error);
    }
  });
}
// Funcin para obtener la ruta del PDF
function getPdfPath(consultationData) {
  const names = consultationData.patient.user.names.replace(" ", "");
  const surenames = consultationData.patient.user.surenames.replace(" ", "");
  const fileName = `${names}_${surenames}_consulta_${moment(
    consultationData.createDate
  ).format("DD-MM-YY")}.pdf`;

  const pdfPath = path.join(CANNA_DOCS_DIR, fileName);
  console.log("PDF Path:", pdfPath);
  return pdfPath;
}

function getSignaturePath() {
  // Ya no depende de PROD/DEV, es relativo al repo
  return SIGNATURES_DIR;
}

module.exports = generateMedicalRecipe;
